const Faq = [
  {
    question: "1.What is the efficency of shovel and dumper?",
    answer:
      "For this problem efficiency of shovel and dumper is taken as 100%.",
  },
  {
    question: "2.What is the cycle time of dumper?",
    answer:
      "Cycle time of dumper is the time taken by dumper to reach to destination(dump) from source, to dump the material and return back to source.",
  },
  {
    question: "3.What is the cycle time of shovel?",
    answer:
      "Cycle time of shovel is the time taken by shovel to cut the material, put it to the dumper and return to the next cutting position.",
  },
];

export default Faq;
